// src/App.js (or where you define your routes)
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import BerichtenPagina from './Berichten/berichten';
import ChatPage from './Berichten/ChatPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/berichten" element={<BerichtenPagina />}>
          {/* Nested route for individual chat */}
          <Route path=":messageId" element={<ChatPage />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
